export default styled.div`
  grid-area: AD;
  display: flex;
  div.docs{
    display: flex;
    width:99vw;
    flex-direction:row;

    overflow-x: auto;
    ::-webkit-scrollbar { 
      display: none;
    }
  div.doc{
white-space: nowrap;
    /* flex-direction:row;
    justify-content: space-between; */
    /* margin-right:500px; */
  }
  }
`
